INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 7001, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 1, "キャル", 1, 7, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 106001);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 7002, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 1, "コッコロ", 1, 7, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105901);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 7003, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 1, "ペコリーヌ", 1, 7, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 10001, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 1, "ペコリーヌ", 1, 10, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 10002, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 1, "キャル", 1, 10, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 106001);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 10003, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 1, "コッコロ", 1, 10, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105901);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 10004, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 1, "シェフィ", 1, 10, 0.0, 2104010, 0.0, 2, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 106401);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-416.5, 12001, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 1, "ペコリーヌ", 1, 12, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 13001, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 1, "キャル", 1, 13, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 106001);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 13002, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 1, "コッコロ", 1, 13, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105901);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 13003, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 1, "シェフィ", 1, 13, 0.0, 2104010, 0.0, 2, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 106401);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 13004, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 1, "ペコリーヌ", 1, 13, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 14001, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 1, "コッコロ", 1, 14, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105901);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 14002, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 1, "シェフィ", 1, 14, 0.0, 2104010, 0.0, 2, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 106401);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 14003, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 1, "ペコリーヌ", 1, 14, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 14004, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 1, "キャル", 1, 14, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 106001);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-470.0, 15001, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 1, "コッコロ", 1, 15, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105901);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 16001, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 1, "シェフィ", 1, 16, 0.0, 2104010, 0.0, 2, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 106401);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 16002, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 1, "ペコリーヌ", 1, 16, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 16003, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 1, "キャル", 1, 16, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 106001);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 16004, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 1, "コッコロ", 1, 16, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105901);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 17002, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 1, "コッコロ", 1, 17, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105901);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 17004, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 1, "キャル", 1, 25, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 106001);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 17005, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 1, "コッコロ", 1, 25, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105901);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 17006, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 1, "シェフィ", 1, 25, 0.0, 2104010, 0.0, 2, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 106401);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 17007, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 1, "ペコリーヌ", 1, 25, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 18001, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 1, "カリン", 1, 18, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 190801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 18002, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 1, "カリン", 2, 18, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 190801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-470.0, 19001, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 1, "カリン", 3, 19, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 190801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-470.0, 19002, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 1, "カリン", 4, 19, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 190801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-470.0, 20001, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 1, "カリン", 5, 20, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 190801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-470.0, 20002, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 1, "カリン", 6, 20, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 190801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 21001, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 1, "キャル", 1, 21, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 106001);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 21002, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 1, "コッコロ", 1, 21, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105901);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 21003, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 1, "シェフィ", 1, 21, 0.0, 2104010, 0.0, 2, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 106401);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 21004, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 1, "ペコリーヌ", 1, 21, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-430.0, 22001, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 1, "カリン", 1, 22, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 190801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-430.0, 22002, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 1, "カリン", 2, 22, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 190801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-430.0, 23001, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 1, "カリン", 3, 23, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 190801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-430.0, 23002, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 1, "カリン", 4, 23, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 190801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-385.0, 24001, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 2, "エリコ（バレンタイン）", 1, 24, 4.08, 0, 8.0, 1, "2019/01/31 12:00:00", 10011, "2030/12/17 14:59:59", 109001);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-385.0, 24002, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 2, "エリコ（バレンタイン）", 2, 24, 5.0, 0, 8.0, 1, "2019/01/31 12:00:00", 10011, "2030/12/17 14:59:59", 109001);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-385.0, 24003, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 2, "エリコ（バレンタイン）", 3, 24, 10.11, 0, 8.0, 1, "2019/01/31 12:00:00", 10011, "2030/12/17 14:59:59", 109001);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-385.0, 24004, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 2, "エリコ（バレンタイン）", 4, 24, 4.0, 0, 8.0, 1, "2019/01/31 12:00:00", 10011, "2030/12/17 14:59:59", 109001);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-385.0, 24005, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 2, "エリコ（バレンタイン）", 5, 24, 6.0, 0, 8.0, 1, "2019/01/31 12:00:00", 10011, "2030/12/17 14:59:59", 109001);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 24006, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 1, "エリコ（バレンタイン）", 6, 24, 0.0, 0, 0.0, 1, "2019/01/31 12:00:00", 10011, "2030/12/17 14:59:59", 109002);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 24007, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 1, "エリコ（バレンタイン）", 7, 24, 0.0, 0, 0.0, 1, "2019/01/31 12:00:00", 10011, "2030/12/17 14:59:59", 109002);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 24008, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 1, "エリコ（バレンタイン）", 8, 24, 0.0, 0, 0.0, 1, "2019/01/31 12:00:00", 10011, "2030/12/17 14:59:59", 109002);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 24009, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 1, "エリコ（バレンタイン）", 9, 24, 0.0, 0, 0.0, 1, "2019/01/31 12:00:00", 10011, "2030/12/17 14:59:59", 109002);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 24010, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 1, "エリコ（バレンタイン）", 10, 24, 0.0, 0, 0.0, 1, "2019/01/31 12:00:00", 10011, "2030/12/17 14:59:59", 109002);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-385.0, 24011, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 2, "シズル（バレンタイン）", 1, 24, 2.12, 0, 8.0, 1, "2019/01/31 12:00:00", 10011, "2030/12/17 14:59:59", 109101);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-385.0, 24012, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 2, "シズル（バレンタイン）", 2, 24, 4.19, 0, 8.0, 5, "2019/01/31 12:00:00", 10011, "2030/12/17 14:59:59", 109101);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-385.0, 24013, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 4, "シズル（バレンタイン）", 3, 24, 2.3, 0, 8.0, 2, "2019/01/31 12:00:00", 10011, "2030/12/17 14:59:59", 109101);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 24014, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 1, "シズル（バレンタイン）", 4, 24, 0.0, 0, 0.0, 1, "2019/01/31 12:00:00", 10011, "2030/12/17 14:59:59", 109102);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-385.0, 24015, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 2, "シズル（バレンタイン）", 5, 24, 5.23, 0, 8.0, 5, "2019/01/31 12:00:00", 10011, "2030/12/17 14:59:59", 109101);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 24016, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 1, "シズル（バレンタイン）", 6, 24, 0.0, 0, 0.0, 1, "2019/01/31 12:00:00", 10011, "2030/12/17 14:59:59", 109102);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-385.0, 24017, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 2, "シズル（バレンタイン）", 7, 24, 5.01, 0, 8.0, 1, "2019/01/31 12:00:00", 10011, "2030/12/17 14:59:59", 109101);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 24018, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 1, "シズル（バレンタイン）", 8, 24, 0.0, 0, 0.0, 1, "2019/01/31 12:00:00", 10011, "2030/12/17 14:59:59", 109102);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 24019, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 1, "シズル（バレンタイン）", 9, 24, 0.0, 0, 0.0, 1, "2019/01/31 12:00:00", 10011, "2030/12/17 14:59:59", 109102);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (0.0, 24020, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 1, "シズル（バレンタイン）", 10, 24, 0.0, 0, 0.0, 1, "2019/01/31 12:00:00", 10011, "2030/12/17 14:59:59", 109102);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 26001, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 1, "シェフィ", 1, 26, 0.0, 2104010, 0.0, 2, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 106401);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 26002, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 1, "ペコリーヌ", 1, 26, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 26003, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", 1, "キャル", 1, 26, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 106001);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 26004, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", 1, "コッコロ", 1, 26, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105901);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 27001, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", 1, "シェフィ", 1, 27, 0.0, 2104010, 0.0, 2, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 106401);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 27002, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", 1, "ペコリーヌ", 1, 27, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 27003, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", 1, "キャル", 1, 27, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 106001);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 27004, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。", 1, "コッコロ", 1, 27, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105901);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 28001, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", 1, "カリン", 1, 28, 0.0, 0, 0.0, 1, "2019/09/24 15:00:00", 0, "2030/12/17 14:59:59", 190801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 28002, "ギルド管理協会です\nフレンドに関しては\nこちらでご確認ください", 1, "カリン", 2, 28, 0.0, 0, 0.0, 1, "2019/09/24 15:00:00", 0, "2030/12/17 14:59:59", 190801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-409.0, 29001, "こちらがフレンドの\n皆さんです\n素敵な関係を\n築いてくださいね！", 1, "カリン", 3, 29, 0.0, 0, 0.0, 1, "2019/09/24 15:00:00", 0, "2030/12/17 14:59:59", 190801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-409.0, 29002, "こちらの一覧で\nフレンドのプロフィールを\n確認できますよ", 1, "カリン", 4, 29, 0.0, 0, 0.0, 1, "2019/09/24 15:00:00", 0, "2030/12/17 14:59:59", 190801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-409.0, 30001, "フレンド管理は\nこちらになります\n新しいフレンドとの出会いを\n楽しんでくださいね！", 1, "カリン", 5, 30, 0.0, 0, 0.0, 1, "2019/09/24 15:00:00", 0, "2030/12/17 14:59:59", 190801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-409.0, 30002, "フレンドの申請や\n承認ができますよ\nどうぞ、良き交流を！", 1, "カリン", 6, 30, 0.0, 0, 0.0, 1, "2019/09/24 15:00:00", 0, "2030/12/17 14:59:59", 190801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-409.0, 31001, "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！", 1, "カリン", 7, 31, 0.0, 0, 0.0, 1, "2019/10/31 12:00:00", 0, "2030/12/17 14:59:59", 190801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-409.0, 31002, "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね", 1, "カリン", 8, 31, 0.0, 0, 0.0, 1, "2019/10/31 12:00:00", 0, "2030/12/17 14:59:59", 190801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-409.0, 32001, "ルーキーの皆さんのために\n特別なミッションを\nご用意いたしました！\nぜひ、挑戦してください！", 1, "カリン", 1, 32, 0.0, 0, 0.0, 1, "2019/12/20 5:00:00", 0, "2020/01/04 4:59:59", 190801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-409.0, 32002, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", 1, "カリン", 2, 32, 0.0, 0, 0.0, 1, "2019/12/20 5:00:00", 0, "2020/01/04 4:59:59", 190801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-409.0, 33001, "フレンドになって\n初心者の方を応援しましょう！\n素敵な報酬が待っていますよ！", 1, "カリン", 3, 33, 0.0, 0, 0.0, 1, "2019/12/20 5:00:00", 0, "2020/01/04 4:59:59", 190801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-409.0, 33002, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", 1, "カリン", 4, 33, 0.0, 0, 0.0, 1, "2019/12/20 5:00:00", 0, "2020/01/04 4:59:59", 190801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-409.0, 34001, "お疲れ様でした！\nミッションの報酬の受け取りは\nこちらからできますよ！", 1, "カリン", 5, 34, 0.0, 0, 0.0, 1, "2020/01/04 5:00:00", 0, "2020/01/10 11:59:59", 190801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-409.0, 34002, "ミッション報酬の受け取りは\nこちら！\n受け取り漏れの無いように\n気を付けてくださいね！", 1, "カリン", 6, 34, 0.0, 0, 0.0, 1, "2020/01/04 5:00:00", 0, "2020/01/10 11:59:59", 190801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-458.0, 38001, "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪", 2, "ペコリーヌ", 1, 38, 5.3, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-458.0, 38002, "これまでのイベントで登場した\n限定キャラを仲間にできたり\nメモリーピースが手に入る\nみたいですよ。やばいですね☆", 2, "ペコリーヌ", 2, 38, 6.5, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (9999.0, 39005, "", 3, "ペコリーヌ", 0, 39, 0.0, 0, 9999.0, 3, "2020/04/01", 0, "2020/04/08 23:59:59", 105801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-430.0, 40001, "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪", 1, "カリン", 2, 40, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 190801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 41001, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", 1, "シェフィ", 1, 41, 0.0, 2104010, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 106401);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 41002, "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！", 1, "ペコリーヌ", 1, 41, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 41003, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", 1, "キャル", 1, 41, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 106001);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 41004, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", 1, "コッコロ", 1, 41, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105901);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-416.5, 42001, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", 1, "コッコロ", 1, 42, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105901);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-416.5, 42002, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", 1, "シェフィ", 1, 42, 0.0, 2104010, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 106401);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-416.5, 42003, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", 1, "ペコリーヌ", 1, 42, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-416.5, 42004, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", 1, "キャル", 1, 42, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 106001);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 43001, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", 1, "ペコリーヌ", 1, 43, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105801);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 43002, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 1, "コッコロ", 1, 43, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 105901);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-363.0, 43003, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 1, "キャル", 1, 43, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 106001);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-416.5, 43004, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 1, "アメス", 1, 44, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 123001);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-416.5, 43005, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 1, "アメス", 2, 44, 0.0, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 123001);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (-416.5, 43006, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 2, "アメス", 3, 45, 5.79, 0, 0.0, 1, "2015/12/17 15:00:00", 0, "2030/12/17 14:59:59", 123001);
